import React,{Component} from 'react'
import b1 from "./../img/b1.PNG";
import Header from "./../components/Header";
import Mainfirst from './../components/Home/Mainfirst1';
import Styleoclock from './../components/Home/Styleoclock2';
import Mainconten from './../components/Home/MainConten3';
import PeopleUser from './../components/Home/PeopleUser4';
import MainLeft from './../components/Home/MainLeft6';
import MainRight from './../components/Home/MainRight7';
import KnowList from './../components/Home/KnowList8';
import ConfirmOclock from './../components/Home/ConfirmOclock9';
import Footer from "./../components/Footer";
class Home extends Component{
	render(){
		return(
<div>
  <Header/>
<section>
    <div className="container">
    <Mainfirst/>
    <Styleoclock/>
    <Mainconten/>
    <PeopleUser/>
 <div className="wrap-cat mac-flex">
    <MainLeft/>
   <MainRight/>
     </div>
     <KnowList/>
    <ConfirmOclock/>
  </div>
  </section>
  {/* ////////////KIẾN THỨC ĐỒNG HỒ////////// */}
  <Footer/>
</div>
)
}
}
export default Home;
